                },
                {
                    id: 2,
                    src: "https://vimeo.com/440828751"
                },

            ]
        };
    }


    render() {
        return (
            <div>
                {this.state.videos.map((data, i) => {
                    return (
                        <div key={i}>
                            <video controls autostart autoPlay src={data.src}/>
                            <p key={i}>{data.id} </p>
                            <p key={i}>{data.src} </p>
                        </div>
                    )
                })}
            </div>
        );
    }
}

export default Videos
